import { throwStatement } from '@babel/types'
import Bootstrap from 'reactstrap'


class Potential_Card extends Component{
  state = {
    dater: {},

  }
  componentDidMount(){
    PCAPI.fetchDaters()
      .then((apiResponseJSON) => {
        this.setState({
          daters: apiResponseJSON
        })
      }
    )
  }


render(){
  const dater = this.state.dater
  return(
    <div>
      <Card >
        <CardImg top-width='100%'/>
          <CardTitle> {dater.name}</CardTitle>
          <CardSubtitle>{dater.City}, {dater.state}</CardSubtitle>
          <CardText>{dater.age}</CardText>
          <Button>See Profile</Button>
      </Card>
    </div>



  )
}
}

export default Potential_Card
